export default (function(a,b,c,d,e,f,g,h,i){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},MGqBY8zuXB:{data:{id:95,attributes:{imdbId:"tt0075648",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMzM4OWM1N2UtZTRkZi00NjA4LThiOGUtNDA4ZDc2OTI1YjBkXkEyXkFqcGdeQXVyMjI4MjA5MzA@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"5.7\u002F10"},{Source:"Metacritic",Value:"36\u002F100"}],item_lang:{data:{id:758,attributes:{title:"Airport '77",plot:"An airplane filled with V.I.P.s invited Mr. Philip Steven's grand opening of his art collection in Florida is hijacked when a trio knock out the passengers with gas and try to steal the priceless cargo of art treasures. But everything goes wrong for the hijackers when the low flying 747 clips an oil rig and crashes in the Bermuda Triangle. While the passengers remain alive in the shallow water, a daring rescue operation is planned to bring the plane up without breaking it in two.",slug:"airport-77"}}},books:{data:[{id:442,attributes:{title:e,description:"The #1 New York Times–bestselling thriller about an airport thrust into chaos by a whiteout blizzard: “A spellbinder” (The Denver Post). As a raging blizzard wreaks havoc at Lincoln International Airport outside Chicago, airport and airline personnel try to cope with this unstoppable force of nature that is endangering thousands of lives. And in the air, a lone plane struggles to reach its destination. Over the course of seven pulse-pounding hours, a tense human drama plays out as a brilliant airport manager, an arrogant pilot, a tough maintenance man, and a beautiful stewardess strive to avert disaster. Featuring a diverse cast of vibrant characters, Airport is both a realistic depiction of the airline industry and a novel of nail-biting suspense. This ebook includes a foreword by the author.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ZBZoAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:h,publisher:i,subtitle:a}},{id:443,attributes:{title:e,description:"Part of a series designed to be suitable for students at upper intermediate level, including those preparing for the Cambridge First Certificate examinations. All titles feature an introduction to the authors, the characters and themes of the text.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=WElapd7prQsC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"1993-01-01",publisher:"Longman Publishing Group",subtitle:a}},{id:444,attributes:{title:"Airport ; Hotel ; Wheels",description:a,thumbnail:a,authors:[b],firstBook:d,published:"1994-01-01",publisher:"Bounty Books",subtitle:a}},{id:445,attributes:{title:"Hotel",description:"The #1 New York Times–bestselling author of Airport reveals the inner workings of a New Orleans hotel—and the human drama unfolding behind its closed doors. During five sultry days, the lives of the guests, the management, and the workers at New Orleans’ largest and most elite hotel converge. The owner has four days to raise the money to save his financially ailing property. The general manager, once blacklisted from the hospitality business, struggles with one crisis after another. A rebellious heiress will do anything to attain her secret desires. The duke and the duchess in the lavish presidential suite are covering up a crime. And within one of the many guest rooms hides a professional thief. Filled with memorable characters and authentic detail about the inner machinery and secrets of a five-star hotel, this gripping New York Times bestseller sold millions of copies and was adapted for both film and TV. Set in a time when travel was still glamorous and grand independent hotels set the standard for luxury, it’s a read like a vacation in itself, from the author of such behind-the-scenes blockbusters as The Moneychangers and Wheels.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=rhZoAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:h,publisher:i,subtitle:a}},{id:446,attributes:{title:e,description:"Over de gebeurtenissen die zich afspelen rond een vliegveld, waar door de slechte weersomstandigheden enorme vertragingen zijn ontstaan.",thumbnail:a,authors:[b,"Rosalie Kerr"],firstBook:d,published:"1977-01-01",publisher:"London : Longman",subtitle:a}}]}}},meta:{}}},prerenderedAt:1682568349191}}("","Arthur Hailey","movie",null,"Airport","series",1,"2014-05-13","Open Road Media"))